import React from "react";
// import { Link } from "react-router-dom";

const Map = () => (
  <div>
    <br />
    <br />
    <ul>
      <h2>Where we work: </h2>
      <p>
        Resilience Visitation serves families in Gallatin, Park, and Sweetgrass
        Counties. In circumstances where families are separated by greater
        distances, we may be able to help with the logistics of getting families
        in one place if one of the parties is in our services area. Services may
        be provided in-home, at a park or other community setting, or in an
        office. At this time, we only work with families referred to us by Child
        and Family Services.
      </p>
      <img src="pic/map.jpg" style={{ width: 2000, height: 'auto' }}/>
    </ul>
  </div>
);

export default Map;
